<item>
<title>2007-06-26 12:05:18</title>
<link>http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/ChtoTakoeIPStudioAMBS/show&amp;time=2007-06-26+12%3A05%3A18</link>
<description>&lt;div class="pageBefore">&lt;img src="http://78.46.73.113/wiki/images/z.gif" width="1" height="1" border="0" alt="" style="display:block" align="top" />&lt;/div>&lt;div class="page">
&lt;b>Сравнение версий &lt;a  href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/ChtoTakoeIPStudioAMBS&amp;amp;v=ch6" class="">/Документация&amp;nbsp;IP&amp;nbsp;Studio&amp;nbsp;AMBS&amp;nbsp;/&amp;nbsp;Что&amp;nbsp;Такое&amp;nbsp;IP&amp;nbsp;Studio&amp;nbsp;AMBS&lt;/a> за &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/ChtoTakoeIPStudioAMBS&amp;amp;time=2007-06-26+12%3A05%3A18">2007-06-26 12:05:18&lt;/a> и &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/ChtoTakoeIPStudioAMBS&amp;amp;time=2007-06-26+12%3A06%3A40">2007-06-26 12:06:40&lt;/a>&lt;/b>&lt;br />
&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">IP&amp;nbsp;Studio AMBS – это&amp;nbsp;автоматизированная система управления и&amp;nbsp;расчетов. Данная система представляет собой программный продукт, предназначенный для&amp;nbsp;крупных и&amp;nbsp;средних операторов связи.  Основной особенностью системы является полная автоматизация управления софтсвитчами и&amp;nbsp;голосовыми шлюзами. &lt;br />
В&amp;nbsp;IP Studio AMBS реализована система динамической маршрутизации, которая выполняет построение таблиц маршрутизации на&amp;nbsp;основе цены направлений, а&amp;nbsp;также на&amp;nbsp;основании анализа качественных показателей работающих направлений. Учитываются приоритеты серверов, качество каналов и&amp;nbsp;цены. IP&amp;nbsp;Studio AMBS автоматически перенаправляет звонки на&amp;nbsp;каналы с&amp;nbsp;наилучшим качеством, учитывая при&amp;nbsp;этом интересы компании и&amp;nbsp;приводит к&amp;nbsp;увеличению прибыли без&amp;nbsp;увеличения затрат.&lt;/div>&lt;br />
&lt;b>Удалено:&lt;/b>&lt;br />
&lt;div class="deletions">IP&amp;nbsp;Studio AMBS – Автоматизированная система управления и&amp;nbsp;расчетов. Данная система представляет собой программный продукт, предназначенный для&amp;nbsp;крупных и&amp;nbsp;средних операторов связи.  Основной особенностью системы является полная автоматизация управления софтсвитчами и&amp;nbsp;голосовыми шлюзами. &lt;br />
В&amp;nbsp;IP Studio AMBS реализована система динамической маршрутизации, которая выполняет построение таблиц маршрутизации на&amp;nbsp;основе цены направлений, а&amp;nbsp;также на&amp;nbsp;основании анализа качественных показателей работающих направлений. Так&amp;nbsp;же&amp;nbsp;учитываются приоритеты серверов, качество каналов и&amp;nbsp;цены. AMBS автоматически перенаправляет звонки на&amp;nbsp;каналы с&amp;nbsp;наилучшим качеством, учитывая при&amp;nbsp;этом интересы компании. Эта&amp;nbsp;приводит к&amp;nbsp;увеличению прибыли без&amp;nbsp;увеличения затрат.&lt;/div>&lt;/div>
</description>
</item>
